import React, { useState } from 'react';
import Login from '../login/Login'
const Home = () => {
    const [loginIsOpen, setLoginIsOpen] = useState(false);
    const openModal = () => {
        setLoginIsOpen(true);
    }
    return (<>
        <button onClick={openModal}>Open Modal</button>
        {loginIsOpen ? <Login /> : null}
    </>);
}

export default Home;
